import React, { useState } from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import events from '../data/EventsData';

const mapContainerStyle = {
  width: '100%',
  height: '400px',
  filter: 'grayscale(100%)'
};

const center = {
  lat: 40.73061,
  lng: -73.935242
};

const Events = () => {
  const [selectedEvent, setSelectedEvent] = useState(null);

  const handleEventClick = (event) => {
    setSelectedEvent(event);
  };

  return (
    <div className="container mx-auto p-4">
      <div className="relative">
        <LoadScript googleMapsApiKey="AIzaSyBY43v8BjB__fBjGwkgRiEePOc7_oJv9vA">
          <GoogleMap
            mapContainerStyle={mapContainerStyle}
            center={selectedEvent ? selectedEvent.coordinates : center}
            zoom={12}
          >
            {selectedEvent && <Marker position={selectedEvent.coordinates} />}
          </GoogleMap>
        </LoadScript>
        <h1 className="absolute bottom-0 left-0 p-4 text-10xl font-bold text-white">Upcoming Events</h1>
      </div>
      <div className="mt-6 grid gap-6">
        {events.map(event => (
          <div key={event.id} className="bg-white p-4 rounded-lg shadow-lg cursor-pointer" onClick={() => handleEventClick(event)}>
            <h2 className="text-xl font-semibold mb-2">{event.name}</h2>
            <p><strong>Date:</strong> {event.date}</p>
            <p><strong>Time:</strong> {event.time}</p>
            <p><strong>Host:</strong> {event.host}</p>
            <p><strong>Location:</strong> {event.location}</p>
            <p><strong>Cost:</strong> {event.cost}</p>
            <p><strong>Attendees:</strong> {event.attendees}/{event.capacity}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Events;
